import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';
import { RouterModule } from '@angular/router';

import { AppComponent } from './app.component';
import { NavMenuComponent } from './nav-menu/nav-menu.component';
import { HomeComponent } from './home/home.component';
import { CounterComponent } from './counter/counter.component';
import { FetchDataComponent } from './fetch-data/fetch-data.component';

import {HomeEmployeeComponent} from './employee/home-employee/home-employee.component';
import {NavMenuEmployeeComponent} from './employee/nav-menu-employee/nav-menu-employee.component';
import { AddEmployeeComponent} from './employee/add-employee/add-employee.component';
import {UpdateEmployeeComponent} from "./employee/update-employee/update-employee.component";
import {EmployeeModalComponent} from './employee/ModalEmployee/employee-modal/employee-modal.component';

import { BrowserAnimationsModule } from '@angular/platform-browser/animations';



@NgModule({
  declarations: [
    AppComponent,
    NavMenuComponent,
    HomeComponent,
    CounterComponent,
    FetchDataComponent,
    HomeEmployeeComponent,
    NavMenuEmployeeComponent,
    AddEmployeeComponent,
    UpdateEmployeeComponent,
    EmployeeModalComponent
  ],
  imports: [
    BrowserModule.withServerTransition({ appId: 'ng-cli-universal' }),
    HttpClientModule,
    FormsModule,
    RouterModule.forRoot([
      { path: '', component: HomeComponent, pathMatch: 'full' },
      { path: 'counter', component: CounterComponent },
      { path: 'fetch-data', component: FetchDataComponent },
      {path: 'home-employee',component: HomeEmployeeComponent},
      {path: 'add-employee', component: AddEmployeeComponent},
      {path: 'update-employee', component: UpdateEmployeeComponent}
    ]),
    BrowserAnimationsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
